import React from 'react';
import EmailItem from './EmailItem';

const inboxEmails = [
  { id: 1, subject: "Welcome to Mock Gmail", sender: "admin@mockgmail.com", body: "Thank you for signing up!" },
  { id: 2, subject: "Your Account Verification", sender: "support@mockgmail.com", body: "Please verify your email address." },
];

const InboxPage = () => {
  return (
    <div>
      <h2>Inbox</h2>
      {inboxEmails.map(email => (
        <EmailItem key={email.id} email={email} />
      ))}
    </div>
  );
};

export default InboxPage;
